import alphabet from './images/alphabet.svg'
import { NavLink } from 'react-router-dom'
const Alphabets = () => {

    return (
        <NavLink className="module1" activeClassName="module1" to="/Alphabetslec">
            <div className="title"><img src={alphabet} className="image2" /><h2 className='word'>ALÚFÁBẸ́Ẹ̀TÌ</h2></div><br></br>
            <div className="title-content"><h5>Get started with learning alphabets in Yoruba<br></br>Lets GO!</h5></div>
        </NavLink>
    )
}

export default Alphabets
